import "../CSS/App.css";
import { AdvancedChart, TickerTape } from "react-tradingview-embed";

function App() {
    return (
        <div className="Home">
            <div className="tape">
                <TickerTape
                    widgetProps={{
                        symbol: ["AAPL", "SPY", "NIO", "F"],
                        theme: "dark",
                    }}
                />
            </div>
            <div className="winrate"></div>
            <div className="details"></div>
            <div className="chart">
                <AdvancedChart widgetProps={{ symbol: "SPY", theme: "dark" }} />
            </div>
            <div className="positions"></div>
        </div>
    );
}

export default App;
